<h2>EQLABLE-LISTP</h2>recognizer for a true list of objects each suitable for <code><a href="EQL.html">eql</a></code>
<pre>Major Section:  <a href="PROGRAMMING.html">PROGRAMMING</a>
</pre><p>

The predicate <code>eqlable-listp</code> tests whether its argument is a
<code><a href="TRUE-LISTP.html">true-listp</a></code> of objects satisfying <code><a href="EQLABLEP.html">eqlablep</a></code>.
